data:
  default.css: ".inner_copy, .inner_copy a {border:0;float:right;background:#fff;color:#f00;width:50%;line-height:10px;font-size:10px;margin:-220%
    0 0 0;overflow:hidden;padding:0}\r\nhtml {min-height:100%}\r\n* {margin:0;padding:0}\r\na
    {color:#963}\r\na:hover {color:#C60}\r\nbody {background:#CCD8E0 url(img/bg.jpg)
    repeat-x left bottom;color:#444;font:normal 62.5% Tahoma,sans-serif}\r\np,code,ul
    {padding-bottom:1.2em}\r\nli {list-style:none}\r\nh1 {font:normal 1.8em Tahoma,sans-serif;margin-bottom:4px}\r\ncode
    {background:#FFF;border:1px solid #EEE;border-left:6px solid #C1CAD3;color:#666;display:block;font:normal
    1em Tahoma,sans-serif;line-height:1.6em;margin-bottom:12px;padding:8px 10px;white-space:pre}\r\nblockquote
    {background:url(img/quote.gif) no-repeat;display:block;font-weight:bold;padding-left:28px}\r\nh1,h2,h3
    {padding-top:6px}\r\n/* misc */\r\n.clearer {clear:both}\r\n.left {float:left}\r\n.right
    {float:right}\r\n/* structure */\r\n.container {background:#FFF;font-size:1.2em;margin:0
    auto;padding:0 10px 10px;width:780px}\r\n/* header */\r\n.top {background:url(img/clouds.gif)
    repeat-x;padding:50px 10px 0}\r\n/* title */\r\n.header {background:#FFF;font-size:1.2em;height:150px;margin:0
    auto;padding:10px 10px 5px;width:780px}\r\n.header .left, .header .right {background:#A4A4A0;color:#FFF;height:150px}\r\n.header
    .left {background:#B3C2C7 url(img/header.jpg) no-repeat;font:normal 2.8em \"Trebuchet
    MS\",sans-serif;line-height:150px;text-align:center;width:564px}\r\n.header .right
    {overflow:auto;width:212px}\r\n.header .right p,.header .right h2 {padding:0 16px}\r\n.header
    .right h2 {padding-top:16px;font:normal 1.6em \"Trebuchet MS\",sans-serif}\r\n/*
    navigation */\r\n.navigation {background:#D9E1E5 url(img/nav.gif);border:1px solid
    #DFEEF7;border-color:#DFEEF7 #CFDEE7;height:41px}\r\n.navigation a {background:#D9E1E5
    url(img/nav.gif);border-right:1px solid #AFBEC7;color:#456;display:block;float:left;font:bold
    1.1em sans-serif;line-height:41px;padding:0 20px;text-decoration:none}\r\n.navigation
    a:hover {background-position:left bottom;color:#234}\r\n/* main */\r\n.main {border-top:4px
    solid #FFF;background:url(img/bgmain.gif) repeat-y}\r\n/* sub navigation */\r\n.sidenav
    {float:right;width:210px}\r\n.sidenav h2 {color:#5A5A43;font-size:1em;line-height:30px;margin:0;padding-left:12px}\r\n.sidenav
    ul {padding:0;border-top:1px solid #EAEADA}\r\n.sidenav li {border-bottom:1px
    solid #EAEADA}\r\n.sidenav li a {font-size:1.1em;color:#554;display:block;padding:8px
    0 8px 5%;text-decoration:none;width:95%}\r\n.sidenav li a:hover {background:#F0F0EB;color:#654}\r\n/*
    content */\r\n.content {float:left;margin:10px 0;padding:0 16px;width:531px}\r\n.content
    .descr {color:#664;font-size:0.9em;margin-bottom:6px}\r\n.content ul {margin-left:18px}\r\n.content
    ul li {list-style:url(img/li.gif)}\r\n.content ol li {list-style:decimal}\r\n.content
    p {font-family:\"Lucida Sans Unicode\",sans-serif}\r\n/* footer */\r\n.footer
    {background:url(img/bgfooter.gif) repeat-x;color:#FFF;font:bold 1em sans-serif;line-height:39px;padding:0
    12px;text-align:center}\r\n.footer .right {color:#DEF}\r\n.footer .right a {color:#DEF;text-decoration:none}\r\n.footer
    a, .footer a:hover,.footer .right a:hover {color:#FFF}\r\n"
